import React, {useState} from 'react';

function Step(props) {

      const [isActive, setIsActive] = useState(false);

      return (
          <div onClick={() => setIsActive(!isActive)} className="step">
                <h1>{props.title}</h1>
                <div style={props.sectionAppear}>{props.content}</div>
          </div>  
      )
}

export default Step;
